import axios from "axios";
import { URL } from "../store/URL";



const getS = async () => {
  // const response = await axios.get(`${URL}/product/get`);
  const response = await axios.get("http://localhost:4000/product/get")
  return response.data;
};


const addS = async(data) => {
  // const response = await axios.post(`${URL}/product/add`,data)
  console.log('service', data);
  const response = await axios.post("http://localhost:4000/product/add",data)
  return response.data
}



const productService = {
  addS,
  getS
}

export default productService
